                "description": "<span style= \"font-size: 94%; font-family:helvetica; margin:0px;\">Well, let's try and get some young people up here. Those types never liked me anyways. AOC, people like her right? Jon Ossoff is running for senator this year, get him up there. There is this gay Mayor from Indiana, Pete, he seems young.</span>"
